-- Table structure for we_game_role
-- ----------------------------
DROP TABLE IF EXISTS `we_game_role`;
CREATE TABLE `we_game_role` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL,
  `headImg` varchar(200) DEFAULT NULL,
  `personImg` varchar(200) DEFAULT NULL,
  `haveChild` int(11) DEFAULT NULL,
  `professional` varchar(20) DEFAULT NULL,
  `age` int(11) DEFAULT NULL,
  `model` int(11) DEFAULT NULL,
  `bankSavings` int(11) DEFAULT NULL,
  `wage` int(11) DEFAULT NULL,
  `houseLoan` int(11) DEFAULT NULL,
  `educationLoan` int(11) DEFAULT NULL,
  `carLoan` int(11) DEFAULT NULL,
  `creditCard` int(11) DEFAULT NULL,
  `additionalDebt` int(11) DEFAULT NULL,
  `tax` int(11) DEFAULT NULL,
  `houseInterest` int(11) DEFAULT NULL,
  `educationInterest` int(11) DEFAULT NULL,
  `carInterest` int(11) DEFAULT NULL,
  `creditCardInterest` int(11) DEFAULT NULL,
  `additionalInterest` int(11) DEFAULT NULL,
  `otherInterest` int(11) DEFAULT NULL,
  `introduction` varchar(200) DEFAULT NULL,
  `gender` int(11) DEFAULT NULL,
  `modelSave` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=100007 DEFAULT CHARSET=utf8;

