-- Records of we_game_role
-- ----------------------------

-- ----------------------------
-- Table structure for we_game_statistics
-- ----------------------------
DROP TABLE IF EXISTS `we_game_statistics`;
CREATE TABLE `we_game_statistics` (
  `gameStatisticsId` int(11) NOT NULL AUTO_INCREMENT,
  `playerId` varchar(36) NOT NULL,
  `winScreenings` int(11) NOT NULL,
  `failScreenings` int(11) NOT NULL,
  `winrate` varchar(10) NOT NULL,
  `whenLong` varchar(20) NOT NULL,
  `status` int(2) NOT NULL DEFAULT '0',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`gameStatisticsId`),
  UNIQUE KEY `game_statistics_playerId_uindex` (`playerId`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

