DROP TABLE IF EXISTS `we_game_version`;
CREATE TABLE `we_game_version` (
  `version_id` int(11) NOT NULL AUTO_INCREMENT,
  `version_code` varchar(20) DEFAULT NULL,
  `compatible` varchar(50) DEFAULT NULL,
  `android_download` varchar(50) DEFAULT NULL,
  `ios_download` varchar(50) DEFAULT NULL,
  `remark` varchar(300) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `status` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`version_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

