DROP TABLE IF EXISTS `we_player`;
CREATE TABLE `we_player` (
  `id` varchar(36) NOT NULL,
  `player_name` varchar(12) DEFAULT NULL,
  `player_avatar` varchar(100) DEFAULT NULL,
  `user_id` varchar(36) DEFAULT NULL,
  `player_status` int(11) NOT NULL DEFAULT '1',
  `player_gender` int(11) DEFAULT NULL,
  `player_play_num` int(11) DEFAULT NULL,
  `player_birthday` varchar(50) DEFAULT NULL,
  `player_constellation` varchar(50) DEFAULT NULL,
  `create_time` varchar(36) DEFAULT NULL,
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `player_user_id_uindex` (`user_id`),
  UNIQUE KEY `player_name_uindex` (`player_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

