-- ----------------------------
-- Table structure for we_user
-- ----------------------------
DROP TABLE IF EXISTS `we_user`;
CREATE TABLE `we_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `user_phone` varchar(11) DEFAULT NULL COMMENT '用户手机',
  `user_pwd` varchar(64) DEFAULT NULL COMMENT '用户密码',
  `wechat_id` varchar(36) DEFAULT NULL COMMENT '微信openid',
  `user_status` int(1) NOT NULL DEFAULT '1' COMMENT '用户状态默认1正常0非正常',
  `user_type` varchar(11) NOT NULL DEFAULT '' COMMENT '用户类型',
  `create_time` varchar(36) DEFAULT NULL COMMENT '创建时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '当前时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_phone_uindex` (`user_phone`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;

