INSERT INTO `we_card_charity` VALUES ('1', '慈善与公益', '当我们运用金钱来展示自己的人性本质---我们最崇高的理想以及灵魂最深处使命与价值时，它就具有强大的疗愈力量，即便是极少的金钱亦能通过流动产生巨大的能量。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('2', '慈善与公益', '我们所有人都是充裕的，这一认知会完全改变我们的游戏规则。地球上的资源足以满足甚至超过我们的需求，完全能够保证我们拥有健康，富裕的生活。我们应重新对健康和财富定义，对所依赖生存的游戏规则进行一次大调整，才能彰显这一新的模式。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('3', '慈善与公益', '如果我们了解过去赚取金钱的方式或者某些花钱的决定所带来的真正后果，我们将会彻底改变我们的生活方式。真正增加事物的价值的是人们的感恩和祝福。我们应该将其看作如水一般流动的能量，是彼此关爱的能量，而不是我们必须积累的一个静态数字。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('4', '慈善与公益', '金钱只有在流动，互助与分享，被运用在有助生命成长的事情上时，才有其意义与价值。正如血液必须输送到身体的每个部位才能维持健康，如果血液流动的缓慢，甚至停滞或凝结，身体就会生病。 如果水流凝滞，就会成为有害的物质。同样，囤积大量的金钱对我们人生也是有害的。 感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('5', '慈善与公益', '慈善不仅仅与穷人有关，那些所谓的权贵及富人，他们需要的同情和帮助是不同的。过多的物质和金钱会使他们远离日常生活的丰盛，脱离正常和健康的施受关系，失去有意义的劳动以及更好的人生体验。这常常使得他们与金钱的关系变得更扭曲，并日渐背离灵魂的愿望。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('6', '慈善与公益', '在与金钱的关系中重新看到真正的自己，并以金钱作为媒介表达灵魂的真诚与完整， 这一切所带来的喜悦正是对人们最美好的回报。让我们一起关爱生命！感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('7', '慈善与公益', '金钱本身并无法保证充实的人生，反而，巨额财富常常阻碍人们拥有充实的人生。人们都了解贫穷的负面性，但却很少有人能够看到拥有物质财富的负面性，几乎没有人认识到富裕其实也常常是一个陷阱，以及其所带来的痛苦，孤独，孤立，心肠变硬，以及心灵所陷入的饥饿与贫穷。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('8', '慈善与公益', '金钱，应效地被运用在最紧迫的人类中心问题上，加深与心灵的链接并将其导向与金钱的和谐关系是重要的。这是一种新的修行方法，让心灵来平衡与滋养我们的金钱文化，与金钱的关系也是一个演练场，供我们每天进行这一有意义的灵性练习。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('9', '慈善与公益', '慈善事业要帮助的不仅是穷人，有钱人往往更需要被引导。虽然拥有丰厚的物质条件，但精神上却极度贫乏，金钱成为了他们提高伤害能力的工具，也对社会带来了负面影响。他们失去了与自然的链接，被困在特权的监狱中，并有可能成为其最黑暗面的受害者，传播健康的财富文化，从今天开始！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('10', '慈善与公益', '金钱是一种具有威力的能量，但金钱总是遮住灵魂的光芒，人们刻意回避金钱问题，使其备受忽视。从今天开始，我们要传播财富文化的正能量！感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('11', '慈善与公益', '无论穷人还是富人，都在金钱的游戏中遭受不同层度的苦。优越的生活切断了富人与平民百姓之间的交往， 使得他们无法获得人与人之间普通交往与真实关系的必要经验，普及财富文化的教育，将有助于社会的稳定和正向发展。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('12', '慈善与公益', '我们来到一个被金钱定义的文化中，-我们一生中各种貌似无害的日常行为逐渐使我们与金钱的关系变得扭曲，我们需要为社会树立一个正确的财富观。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('13', '慈善与公益', '勇敢地面对金钱的挑战，对金钱的恐惧，痴迷，以及与金钱有关的懊悔，遗憾与伤痛，从而将这一切都当作个人成长与自我转变的机遇。如此，为金钱赋予灵魂，并将其升华为人民服务的工具。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('14', '慈善与公益', '无论我们拥有何种身份，身处何种情境，人们所谈论的都是，自己缺少了什么? 而不是看到已拥有的一切，这其实是一切贫穷的根源。我们需要为社会树立一个正确的财富观。感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('15', '慈善与公益', '因为匮乏的心态，我们与金钱的关系充满恐惧，它驱使我们无休止地追逐更多的东西，永远得不到满足。不够，成了我们不能成为我们想成为的人的借口，成了我们无法完成目标，无法实现梦想的托词，成了他人让我们失望的解释，成了我们牺牲自己的真诚与完整，自我放弃，小看让人的理由。颠覆这一认知，就是富足的开始！感恩您对慈善和公益事业的支持！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('16', '慈善与公益', '人们尚未认识到万物的一体性，那时的基本经济理论体系完全基于不完善的假设与错误的思维。-匮乏的观念在我们的心中创造了潜在的恐惧，恐惧我们或者我们挚爱与关心的人没有足够的物质资源来度过一个满足，幸福，富饶的人生。传播健康的财富文化，从今天开始！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('17', '慈善与公益', '过往的经济体系理论是根据人们的贪婪而分配有限的资源，其过程完全是根植于一种匮乏的认知和恐惧感，使这个过程成为现实的工具则是金钱。让人们陷入贫穷的是一个具有欺骗性的认知，我们相信自己生活在一个愿望很难实现的世界。然而，共享时代来临了，颠覆过去的认知，就是富足的开始！传播健康的财富文化，从今天开始！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_charity` VALUES ('18', '慈善与公益', '“资源紧缺”已经成了我们做自己不喜欢的工作的理由。不断增加物质财富的迫切心理使人们更加忽略对自我价值的深入探索。人们忘记了，自己才是富足的源泉！传播健康的财富文化，从今天开始！', '2018-06-21 15:59:13', '2018-06-21 15:59:13');
INSERT INTO `we_card_health` VALUES ('1', '立春', '立春：初候，东风解冻；阳和至而坚凝散也。 二候，蛰虫始振；振，动也。三侯，鱼陟负冰。 陟，言积，升也，高也。阳气已动，鱼渐上游而近于冰也。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('2', '雨水', '雨水：初候，獭祭鱼。此时鱼肥而出，故獭而先祭而后食。二候，候雁北；自南而北也。三候，草木萌动。是为可耕之候。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('3', '惊蛰', '惊蛰：初候，桃始华；阳和发生，自此渐盛。 二候，仓庚鸣；黄鹂也。 三候，鹰化为鸠。鹰，鸷鸟也。此时鹰化为鸠，至秋则鸠复化为鹰。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('4', '春分', '春分：初候，玄鸟至；燕来也。 二候，雷乃发声。雷者阳之声，阳在阴内不得出，故奋激而为雷。 三候，始电。电者阳之光，阳气微则光不见，阳盛欲达而抑于阴。其光乃发，故云始电。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('5', '清明', '清明：初候，桐始华。二候，田鼠化为鴽，牡丹华；鴑音如，鹌鹑属，鼠阴类。阳气盛则鼠化为鴽，阴气盛则鴽复化为鼠。 三候，虹始见。虹，音洪，阴阳交会之气，纯阴纯阳则无，若云薄漏日，日穿雨影，则虹见。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('6', '谷雨', '谷雨：初候，萍始生。二候，鸣鸠拂其羽，飞而两翼相排，农急时也。 三候，戴胜降于桑，织网之鸟，一名戴鵀，阵于桑以示蚕妇也，故曰女功兴而戴鵀鸣。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('7', '立夏', '立夏：初候，蝼蝈鸣；蝼蛄也，诸言蚓者非。 二候，蚯蚓出；蚯蚓阴物，感阳气而出。 三候，王瓜生；王瓜色赤，阳之盛也。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('8', '小满', '小满：初候，苦菜秀；火炎上而味苦，故苦菜秀。 二候，靡草死；葶苈之属。 三候，麦秋至。秋者，百谷成熟之期。此时麦熟，故曰麦秋。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('9', '芒种', '芒种：初候，螳螂生；俗名刀螂，说文名拒斧。 二候，鹃始鸣；鹃，屠畜切，伯劳也。 三候，反舌无声。百舌，鸟也。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('10', '夏至', '夏至：初候，鹿角解；阳兽也，得阴气而解。 二候，蜩始鸣，蜩，音蜩，蝉也。 三候，半夏生。药名也，阳极阴生。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('11', '小暑', '小暑：初候，温风至。二候，蟋蜂居壁；亦名促织，此时羽翼未成，故居壁。 三候，鹰始挚。挚，言至，鹰感阴气，乃生杀心，学习击搏之事。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('12', '大暑', '大暑：初候，腐草为萤；离明之极，故幽类化为明类。 二候，土润溽暑；溽，音辱，湿也。三候，大雨行时。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('13', '立秋', '立秋：初候，凉风至。二候，白露降。三候，寒蝉鸣。蝉小而青赤色者。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('14', '处暑', '处暑：初候，鹰乃祭鸟；鹰，杀鸟。不敢先尝，示报本也。 二候，天地始肃；清肃也，寨也。 三候，禾乃登。稷为五谷之长，首熟此时。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('15', '白露', '白露：初候，鸿雁来；自北而南也。 一曰：大曰鸿，小曰雁。二候，玄鸟归；燕去也。三候，群鸟养羞。羞，粮食也。养羞以备冬月。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('16', '秋分', '秋分：初候，雷始收声；雷于二月阳中发生，八月阴中收声。 二候，蛰虫坯户；坯，昔培。坯户，培益其穴中之户窍而将蛰也。 三候，水始涸。国语曰：辰角见而雨毕，天根见而水涸，雨毕而除道，水涸而成梁。辰角者，角宿也。天根者，氐房之间也。见者，旦见于东方也。辰角见九月本，天根见九月末，本末相去二十一余。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('17', '寒露', '寒露：初候，鸿雁来宾。宾，客也。先至者为主，后至者为宾，盖将尽之谓。二候，雀入大水为蛤；飞者化潜，阳变阴也。 三候，菊有黄花。诸花皆不言，而此独言之，以其华于阴而独盛于秋也。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('18', '霜降', '霜降：初候，豺乃祭兽；孟秋鹰祭鸟，飞者形小而杀气方萌，季秋豺祭兽，走者形大而杀气乃盛也。二候， 草木黄落；阳气去也。 三候，蛰虫咸俯。俯，蛰伏也。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('19', '立冬', '立冬：初候，水始冰。二候，地始冻。三候，雉入大水为蜃。蜃，蚌属。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('20', '小雪', '小雪：初候，虹藏不见，季春阳胜阴，故虹见；孟冬阴胜阳，故藏而不见。 二候，天气上升，地气下降。三候， 闭塞而成冬。阳气下藏地中，阴气闭固而成冬。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('21', '大雪', '大雪：初候，鹖鴠不鸣。鹖鴠，音曷旦，夜鸣求旦之鸟，亦名寒号虫，乃阴类而求阳者，兹得一阳之生，故不鸣矣。 二候，虎始交；虎本阴类。感一阳而交也。三候，荔挺出。荔，一名马蔺，叶似蒲而小，根可为刷。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('22', '冬至', '冬至：初候，蚯蚓结；阳气未动，屈首下向，阳气已动，回首上向，故屈曲而结。 二候，麇角解；阴兽也。得阳气而解。 三候，水泉动，天一之阳生也。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('23', '小寒', '小寒：初候，雁北乡；一岁之气，雁凡四候。如十二月雁北乡者，乃大雁，雁之父母也。正月侯雁北者，乃小雁，雁之子也。盖先行者其大，随后者其小也。此说出晋干宝，宋人述之以为的论。 二候，鹊始巢；鹊知气至，故为来岁之巢。 三候，雉雊；雊，句姤二音，雉鸣也。雉火畜，感于阳而后有声。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('24', '大寒', '大寒：初候，鸡乳；鸡，水畜也，得阳气而卵育，故云乳。 二候，征鸟厉疾；征鸟，鹰隼之属，杀气盛极，故猛厉迅疾而善于击也。 三候，水泽腹坚。阳气未达，东风未至，故水泽正结而坚。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('25', '立春', '立春：斗指东北。太阳黄经为315度。是二十四个节气的头一个节气。其含义是开始进入春天，“阳和起蛰，品物皆春”，过了立春，万物复苏生机勃勃，一年四季从此开始了。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('26', '雨水', '雨水：斗指壬。太阳黄经为330°。这时春风遍吹，冰雪融化，空气湿润，雨水增多，所以叫雨水。人们常说：“立春天渐暖，雨水送肥忙”。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('27', '惊蛰', '惊蛰：斗指丁。太阳黄经为345°。这个节气表示“立春”以后天气转暖，春雷开始震响，蛰伏在泥土里的各种冬眠动物将苏醒过来开始活动起来，所以叫惊蛰。这个时期过冬的虫排卵也要开始孵化。我国部分地区进入了春耕季节。谚语云：“惊蛰过，暖和和，蛤蟆老角唱山歌”。“惊蛰一犁土，春分地气通”。“惊蛰没到雷先鸣，大雨似蛟龙”。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('28', '春分', '春分：斗指壬。太阳黄经为0°。春分日太阳在赤道上方。这是春季90天的中分点，这一天南北两半球昼夜相等，所以叫春分。这天以后太阳直射位置便向北移，北半球昼长夜短。所以春分是北半球春季开始。我国大部分地区越冬作物进入春季生长阶段。各地农谚有：“春分在前，斗米斗钱”（广东）、“春分甲子雨绵绵，夏分甲子火烧天”（四川）、“春分有雨家家忙，先种瓜豆后插秧”（湖北）、“春分种菜，大暑摘瓜”（湖南）、“春分种麻种豆，秋分种麦种蒜”（安徽）。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('29', '清明', '清明：斗指丁。太阳黄经为15°。此时气候清爽温暖，草木始发新枝芽，万物开始生长，农民忙于春耕春种。从前，在清明节这一天，有些人家都在门口插上杨柳条，还到郊外踏青，祭扫坟墓，这是古老的习俗。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('30', '谷雨', '谷雨：斗指癸。太阳黄经为30°。就是雨水生五谷的意思，由于雨水滋润大地五谷得以生长，所以，谷雨就是“雨生百谷”。谚云“谷雨前后，种瓜种豆”。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('31', '立夏', '立夏：斗指东南。太阳黄经为45°。是夏季的开始，从此进入夏天，万物生长旺盛。习惯上把立夏当作是气温显著升高，炎暑将临，雷雨增多，农作物进入旺季生长的一个最重要节气。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('32', '小满', '小满：斗指甲。太阳黄经为60°。从小满开始，大麦、冬小麦等夏收作物，已经结果、籽粒饱满，但尚未成熟，所以叫小满。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('33', '芒种', '芒种：斗指己。太阳黄经为75°。这时最适合播种有芒的谷类作物，如晚谷、黍、稷等。如过了这个时候再种有芒和作物就不好成熟了。同时，“芒”指有芒作物如小麦、大麦等，“种”指种子。芒种即表明小麦等有芒作物成熟。芒种前后，我国中部的长江中、下游地区，雨量增多，气温升高，进入连绵阴雨的梅雨季节，空气非常潮湿，天气异常闷热，各种器具和衣物容易发霉，所以在我国长江中、下游地区也叫“霉雨”。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('34', '夏至', '夏至：斗指乙。太阳黄经为90°。太阳在黄经90°“夏至点”时，阳光几乎直射北回归线上空，北半球正午太阳最高。这一天是北半球白昼最长、黑夜最短的一天，从这一天起，进入炎热季节，天地万物在此时生长最旺盛。所以古时候又把这一天叫做日北至，意思是太阳运行到最北的一日。过了夏至，太阳逐渐向南移动，北半球白昼一天比一天缩短，黑夜一天比一天加长。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('35', '小暑', '小暑：斗指辛。太阳黄经为105°。天气已经很热了，但还不到最热的时候，所以叫小暑。此时，已是初伏前后。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('36', '大暑', '大暑：斗指丙。太阳黄经为120°。大暑是一年中最热的节气，正值勤二伏前后，长江流域的许多地方，经常出现40℃高温天气。要作好防暑降温工作。这个节气雨水多，在“小暑、大暑，淹死老鼠”的谚语，要注意防汛防涝。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('37', '立秋', '立秋：斗指西南。太阳黄经为135°。从这一天起秋天开始，秋高气爽，月明风清。此后，气温由最热逐渐下降。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('38', '处暑', '处暑：斗指戊。太阳黄经为150°。这时夏季火热已经到头了。暑气就要散了。它是温度下降的一个转折点。是气候变凉的象征，表示暑天终止。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('39', '白露', '白露：斗指癸。太阳黄经为165°。天气转凉，地面水汽结露。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('40', '秋分', '秋分：斗指已。太阳黄经为180°。秋分这一天同春分一样，阳光几乎直射赤道，昼夜几乎相等。从这一天起，阳光直射位置继续由赤道向南半球推移，北半球开始昼短夜长。依我国旧历的秋季论，这一天刚好是秋季九十天的一半，因而称秋分。但在天文学上规定，北半球的秋天是从秋分开始的。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('41', '寒露', '寒露：斗指甲。太阳黄经为195°。白露后，天气转凉，开始出现露水，到了寒露，则露水日多，且气温更低了。所以，有人说，寒是露之气，先白而后寒，是气候将逐渐转冷的意思。而水气则凝成白色露珠。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('42', '霜降', '霜降：斗指戌。太阳黄经为210°。天气已冷，开始有霜冻了，所以叫霜降。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('43', '立冬', '立冬：斗指乾。太阳黄经为225°。习惯上，我国人民把这一天当作冬季的开始。冬，作为终了之意，是指一年的田间操作结束了，作物收割之后要收藏起来的意思。立冬一过，我国黄河中、下游地区即将结冰，我国各地农民都将陆续地转入农田水利基本建设和其他农事活动中。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('44', '小雪', '小雪：斗指己。太阳黄经为240°。气温下降，开始降雪，但还不到大雪纷飞的时节，所以叫小雪。小雪前后，黄河流域开始降雪（南方降雪还要晚两个节气）；而北方，已进入封冻季节。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('45', '大雪', '大雪：斗指癸。太阳黄经为255°。大雪前后，黄河流域一带渐有积雪；而北方，已是“千里冰封，万里雪飘”的严冬了。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('46', '冬至', '冬至：斗指子。太阳黄经为270°。冬至这一天，阳光几乎直射南回归线，我们北半球白昼最短，黑夜最长，开始进入数九寒天。天文学上规定这一天是北半球冬季的开始。而冬至以后，阳光直射位置逐渐向北移动，北半球的白天就逐渐长了，谚云：吃了冬至面，一天长一线。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('47', '小寒', '小寒：斗指子，太阳黄经为285°。小寒以后，开始进入寒冷季节。冷气积久而寒，小寒是天气寒冷但还没有到极点的意思。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
INSERT INTO `we_card_health` VALUES ('48', '大寒', '大寒：斗指丑，太阳黄经为300°。大寒就是天气寒冷到了极点的意思。大寒前后是一年中最冷的季节。大寒正值三九刚过，四九之初。谚云：“三九四九冰上走”。', '2018-06-26 15:58:03', '2018-06-26 15:58:03');
