INSERT INTO `we_card_inner_investment` VALUES ('60009', '中华医学药业集团', 'share/atlas/battle/card/investment1/card_g_12.ab', '\\u3000\\u3000投资中华医学药业集团。', '-187500', '48%', '12500', '0', '0', '0', '8', '-2');
INSERT INTO `we_card_inner_investment` VALUES ('60010', '新能源科技控股集团股份', 'share/atlas/battle/card/investment1/card_g_24.ab', '\\u3000\\u3000有机会获得新能源科技控股集团公司10%股份。掷一粒骰子，点数大于或等于3，则流动现金+￥1.2万/月，否则不能增加流动现金。', '-75000', '', '15000', '1', '1', '3', '0', '0');
INSERT INTO `we_card_inner_investment` VALUES ('60011', '私募投资', 'share/atlas/battle/card/investment1/card_g_2.ab', '\\u3000\\u3000私募股权基金月度投资收益率20%。掷一粒骰子，如果点数等于1，则每月获得投资收益，否则失去所有投资资本。', '-750000', '', '1250000', '1', '2', '1', '0', '0');
