INSERT INTO `we_card_inner_rich_relax` VALUES ('70011', '为集团分公司引进职业经理人', 'share/atlas/battle/card/relax1/card_h_1.ab', '\\u3000\\u3000为自己集团下分公司引进职业经理人，其业内薪酬平均水平为30万/年，经沟通这项工作的准备和铺垫基本到位。', '-300000', '50%', '50000', '200', '10', '-3');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70012', '成立财富文化教育基金会', 'share/atlas/battle/card/relax1/card_h_2.ab', '\\u3000\\u3000此NGO基金会是为了团结全球志识之士，以整合资源，共同传播健康的财富文化和智慧。经筹备和沟通，相关准备工作均已完成。', '-375000', '0%', '0', '250', '10', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70013', '配置智达富管理系统', 'share/atlas/battle/card/relax1/card_h_4.ab', '\\u3000\\u3000拥有圆满的财富人生一直是你的梦想，经朋友介绍你了解到智达富是提供自助教育及自助管理服务的平台，可以协助您制作人生地图，尽快实现梦想。', '-75000', '0%', '0', '80', '7', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70014', '配置财富管理系统', 'share/atlas/battle/card/relax1/card_h_5.ab', '\\u3000\\u3000财富的管理是一个庞大而系统的工程， 寻找合适可靠的合作者非常重要，经考察你发现了融裕财富公司的管家服务团队最符合你的理念和需求。', '-225000', '0%', '0', '120', '8', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70015', '为公司购买专利技术', 'share/atlas/battle/card/relax1/card_h_6.ab', '\\u3000\\u3000你的公司正在规划一个产业链的整合，为此，需要购买引进某套专利技术，经多次谈判，你可以30万的总价获得此技术。', '-225000', '20%', '30000', '100', '8', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70016', '撰写家族教育与管理计划', 'share/atlas/battle/card/relax1/card_h_7.ab', '\\u3000\\u3000经过2月的工作，完成家族教育与管理计划的撰写，经过家族会议决策通过后即可实施。', '-45000', '300%', '20000', '50', '9', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70017', '给孩子换一所学校', 'share/atlas/battle/card/relax2/card_h_8.ab', '\\u3000\\u3000你非常重视正确有益的教育理念和方式对于孩子成长的影响，经过长期考察和深入交流，你找到了一家真正能够在日常中落实以孩子们的健康成长为宗旨的学校。', '-112500', '0', '0', '50', '5', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70018', '完成社区人才建设方案', 'share/atlas/battle/card/relax2/card_h_9.ab', '\\u3000\\u3000你计划向社区管委会就社区人才建设方面提案，经多方考察分析，现已基本完成，实施此方案对于社区环境和人们生活有很大的改善作用。', '-112500', '60%', '20000', '80', '8', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70019', '成立家族信托', 'share/atlas/battle/card/relax2/card_h_11.ab', '\\u3000\\u3000家族的发展有赖于稳健的财富管理与组织架构，你决定现在就成立家族信托，以尽早为家族的管理与发展确定基本方向，以及内部经济原则。', '-375000', '20%', '50000', '200', '9', '-3');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70020', '采用家族办公室服务', 'share/atlas/battle/card/relax2/card_h_12.ab', '\\u3000\\u3000家族办公室服务是家族管理中非常重要的一部分，经过2个月左右的筹备工作，现在你可以正式启动此项服务了。', '-187500', '44%', '30000', '150', '9', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70021', '家族未来规划', 'share/atlas/battle/card/relax2/card_h_13.ab', '\\u3000\\u3000你对于家族未来的发展抱有极大的责任感和热情，近期已完成了整体规划，可以开始启动后续相关工作了。', '-112500', '60%', '20000', '100', '7', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70022', '构建家族的共同愿景', 'share/atlas/battle/card/relax2/card_h_14.ab', '\\u3000\\u3000你组织家族成员召开会议，聘用专业的顾问，就家族的共同愿景进行深入探讨及制定方案，使家族工作得以有效展开。', '-135000', '100%', '30000', '120', '8', '-3');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70023', '引进专业的财物顾问团队', 'share/atlas/battle/card/relax2/card_h_15.ab', '\\u3000\\u3000为企业引进专业的财务顾问团队，建立长期合作关系，经过筛选和沟通，这项工作已经完成。', '-225000', '100%', '50000', '100', '8', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70024', '引进专业法律顾问团队', 'share/atlas/battle/card/relax2/card_h_16.ab', '\\u3000\\u3000为企业引进专业的法律顾问团队，建立长期合作关系，经过的筛选和沟通，这项工作已经完成。', '-150000', '80%', '30000', '80', '6', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70025', '引进专业税务顾问团队', 'share/atlas/battle/card/relax2/card_h_17.ab', '\\u3000\\u3000为企业引进专业的税务顾问团队，建立长期合作关系，经过筛选和沟通，这项工作已经完成。', '-225000', '100%', '50000', '100', '8', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70026', '完成企业百年战略规划', 'share/atlas/battle/card/relax2/card_h_19.ab', '\\u3000\\u3000你完成的企业百年战略规划，为企业的进一步发展指明了方向，在此基础上所做出的组织优化与市场巩固均获良好的收效。', '-75000', '380%', '40000', '50', '9', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70027', '构建异业联盟平台', 'share/atlas/battle/card/relax2/card_h_21.ab', '\\u3000\\u3000为更好地为会员服务，你着手规划异业联盟平台的构建方案，经过多方探讨论证，此方案已通过决议。', '-375000', '20%', '50000', '170', '10', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70028', '制定产业指导目录', 'share/atlas/battle/card/relax2/card_h_24.ab', '\\u3000\\u3000国家出台产业整合发展政策，由你的企业牵头制定产业指导目录。', '-112500', '140%', '30000', '80', '7', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70029', '为行业成立公益培训机构', 'share/atlas/battle/card/relax2/card_h_25.ab', '\\u3000\\u3000为促进本行业发展，由你牵头成立了公益培训机构，并组织业内专家为有需要的企业提供培训。', '-187500', '140%', '50000', '100', '7', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70030', '完成年终奖励计划', 'share/atlas/battle/card/relax2/card_h_26.ab', '\\u3000\\u3000你的企业今年获得大规模发展，团队不断壮大，为更有效地提升团队工作的积极性和创造性，人事部在你的指示下已经完成了年终奖励计划。', '-225000', '60%', '40000', '120', '7', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70031', '财富文化环球主题旅游', 'share/atlas/battle/card/relax2/card_h_28.ab', '\\u3000\\u3000这是由你亲自主持开发的一项文化品牌高端旅游服务，首次试行非常成功。鉴于此，经公司决议后即日正式向市场推广。', '-112500', '60%', '20000', '80', '6', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70032', '主办公司年会', 'share/atlas/battle/card/relax2/card_h_29.ab', '\\u3000\\u3000这是合作伙伴共同参、交流和实现资源整合的一个高端平台，你们经过长达半年的精心策划和筹备，各项工作均已到位。', '-60000', '50%', '10000', '40', '4', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70033', '支持资源节约与环境保护专家研讨会', 'share/atlas/battle/card/relax3/card_h_30.ab', '\\u3000\\u3000你的企业一直深切关注资源与环境在现代文明进程中的角色和功能，最近受邀参与主办了支持资源节约与建设生态村的专业研讨会。', '-150000', '20%', '20000', '80', '5', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70034', '投入环境改良', 'share/atlas/battle/card/relax3/card_h_31.ab', '\\u3000\\u3000你所在的城市经过多年的粗放型发展模式，经济产值得以大幅度提升，然而环境破坏和资源浪费等问题同样突出，你公司率先提出进行环境改良的规划方案，经多方勘察论证，已近完善。', '-150000', '80%', '30000', '120', '7', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70035', '完成集团第三方战略行动纲要', 'share/atlas/battle/card/relax3/card_h_32.ab', '\\u3000\\u3000集团第三战略行动纲要由你负责组织团队完成，已提交董事会待决议后执行。', '-60000', '100%', '20000', '100', '7', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70036', '获得国家级项目奖金', 'share/atlas/battle/card/relax3/card_h_33.ab', '\\u3000\\u3000你利用业余时间参加了社区“好环境——好生活”公益活动，并在活动中积极担任策划组织工作，最近，完成了一项用于污水处理的新技术研发，并通过专利审核，此项目获得国家级奖金。', '-112500', '60%', '20000', '35', '3', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70037', '承办全球财富文化高峰论坛', 'share/atlas/battle/card/relax3/card_h_34.ab', '\\u3000\\u3000由你公司承办的全球财富文化高峰论坛将于明年10月份举行，参与此论坛将大幅度提升你公司的品牌形象与知名度，对于传播财富智慧有着重大的意义。', '-225000', '60%', '40000', '150', '7', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70038', '建立社区义工服务系统', 'share/atlas/battle/card/relax3/card_h_35.ab', '\\u3000\\u3000随着城市的发展，社区生活成了不可缺少的一部分，它对于建立友好文明的睦邻关系和提升人们幸福感有着重要的作用。你主动提出为社区开发一套用于义工组织和服务的软件系统。', '-90000', '100%', '20000', '80', '6', '-2');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70039', '成立企业发展顾问委员会', 'share/atlas/battle/card/relax3/card_h_39.ab', '\\u3000\\u3000为健全企业组织，同时也为更好地支持企业决策，你提案成立企业发展顾问委员会，并初步拟定了首批邀请嘉宾作为顾问委员。', '-52500', '242%', '20000', '100', '9', '-1');
INSERT INTO `we_card_inner_rich_relax` VALUES ('70040', '成立财富文化教育学院', 'share/atlas/battle/card/relax3/card_h_40.ab', '\\u3000\\u3000财富文化教育是每个人的必修课，了解创造财富、管理财富、运用财富和超越财富四个阶段的心态和行为，对人们有着重要和深远的意义。为此，你牵头成立了财富文化教育学院，以更广泛和系统地普及健康的财富文化。', '-750000', '20%', '100000', '350', '10', '-4');
INSERT INTO `we_card_outer_big_chance` VALUES ('40004', '3', '稀有的紫檀木家具', 'share/atlas/battle/card/opportunity1/card_a_41.ab', '\\u3000\\u3000在一个交易会上,你发现了一组紫檀木家具,卖价￥30,000,可以自己接受这笔生意,也可以卖给其他玩家。', '1', '30000', '0-300000', '-22500', '0%', '0', '0', '1', '0');
INSERT INTO `we_card_outer_big_chance` VALUES ('40005', '3', '元代青花瓷器待售', 'share/atlas/battle/card/opportunity1/card_a_36.ab', '\\u3000\\u3000元代青花瓷器,对于收藏家将是很好的投资机会。可以自己接受这笔生意,也可以卖给其他玩家。', '1', '40000', '不能确定', '-30000', '0%', '0', '0', '6', '0');
INSERT INTO `we_card_outer_big_chance` VALUES ('40006', '4', '创办饮食文化连锁企业', 'share/atlas/battle/card/opportunity1/card_a_42.ab', '\\u3000\\u3000餐饮服务市场几近饱和,呈现出多、杂、乱的现象,你计划创办饮食文化连锁企业,以倡导和普及健康的饮食方式。可以自己接受这笔生意,也可以给其他玩家。', '1', '250000', '200000-400000', '-75000', '38%', '-150000', '4000', '9', '-4');
INSERT INTO `we_card_outer_big_chance` VALUES ('40007', '4', '面包房', 'share/atlas/battle/card/opportunity1/card_a_54.ab', '\\u3000\\u3000你计划投资加盟开设一家“味多多”面包坊，因为你看好其美妙多样的口味和独特有效的经营管理模式。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '75000', '60000-100000', '-11250', '100%', '-60000', '1000', '11', '-3');
INSERT INTO `we_card_outer_big_chance` VALUES ('40008', '4', '洗衣店', 'share/atlas/battle/card/opportunity1/card_a_55.ab', '\\u3000\\u3000忙碌的工作生活以及对从繁琐的家务劳动中解脱的愿望，使人们对相关服务的需求日渐扩大，你决定在新建成的A社区开设一家洗衣店。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '80000', '70000-120000', '-15000', '69%', '-60000', '1438', '12', '-2');
INSERT INTO `we_card_outer_big_chance` VALUES ('40009', '4', '有机食品店', 'share/atlas/battle/card/opportunity1/card_a_53.ab', '\\u3000\\u3000随着生活水平的提高和大家对健康的重视，越来越多的人选择食用有机食品。一个新建成的高档小区还没有这类的商店，你发现这是一个很好的机会。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '70000', '60000-100000', '-11250', '100%', '-55000', '1563', '15', '-2');
INSERT INTO `we_card_outer_big_chance` VALUES ('40010', '4', '合伙开办艺术培训学校', 'share/atlas/battle/card/opportunity1/card_a_45.ab', '\\u3000\\u3000飞扬艺术培训学校新增音乐和舞蹈两个培训中心，需引进新的股东资本。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '180000', '130000-3000000', '-45000', '46%', '-120000', '2875', '9', '-3');
INSERT INTO `we_card_outer_big_chance` VALUES ('40011', '4', '创立瑜伽养生馆连锁机构', 'share/atlas/battle/card/opportunity1/card_a_44.ab', '\\u3000\\u3000健康养生之风盛行，你邀请一位知名的瑜珈师加盟，共同创办心圆心瑜珈养生馆连锁机构。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '300000', '250000-450000', '-90000', '35%', '-180000', '4375', '9', '-5');
INSERT INTO `we_card_outer_big_chance` VALUES ('40012', '4', '小型动物园', 'share/atlas/battle/card/opportunity1/card_a_60.ab', '\\u3000\\u3000随着有车一族的增加，很多家庭都喜欢在周末自驾到郊区游玩，你计划在万隆山庄旁筹办一个小型生态动物园。可以自己接受这笔生意，也可以卖给别的玩家。', '1', '200000', '350000-500000', '-52500', '48%', '-130000', '3500', '10', '-4');
INSERT INTO `we_card_outer_big_chance` VALUES ('40013', '4', '开办健康餐厅', 'share/atlas/battle/card/opportunity1/card_a_59.ab', '\\u3000\\u3000当今的美食餐饮遍地开花，人们在充分享受外出就餐的美味与便捷的同时，又会为食物的来源及安全性产生担忧，于是你决定开办一家有机食材健康餐厅。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '150000', '150000-250000', '-37500', '43%', '-100000', '2250', '10', '-2');
INSERT INTO `we_card_outer_big_chance` VALUES ('40014', '4', '数码婚纱影楼', 'share/atlas/battle/card/opportunity1/card_a_48.ab', '\\u3000\\u3000现阶段的结婚主体已经慢慢过度到了80、90后的年轻人，他们对婚纱照的重视和要求已经越发的明显。你现在有一个机会可以以较低的价格收购一个经营不善的老式照相馆，通过装修、新设备和新的经营模式来发展自己的婚纱影楼。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '110000', '100000-210000', '-30000', '39%', '-70000', '1625', '7', '-2');
INSERT INTO `we_card_outer_big_chance` VALUES ('40015', '4', '4S店待售', 'share/atlas/battle/card/opportunity1/card_a_35.ab', '\\u3000\\u3000 4S店，卖家想尽快出手。主要经营地点在高速发展区域。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '350000', '售价可能为年流动现金的12-25倍。', '-37500', '36%', '-300000', '1875', '7', '-2');
INSERT INTO `we_card_outer_big_chance` VALUES ('40016', '4', '品牌加盟店代售', 'share/atlas/battle/card/opportunity1/card_a_28.ab', '\\u3000\\u3000由于业主破产，现有业务繁忙、经营良好的品牌加盟店出售。该店位于繁忙的高速路旁。业主不明，所有合同都已结清。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '150000', '目前没有其它买主。', '-22500', '100%', '-120000', '3125', '15', '-4');
INSERT INTO `we_card_outer_big_chance` VALUES ('40017', '4', '创办自然生态旅游公司', 'share/atlas/battle/card/opportunity1/card_a_46.ab', '\\u3000\\u3000你所在的城市是刚刚被批准的国家级生态旅游城市，为抓住这大好的投资开发时机，你计划创办了云边自然生态旅游公司。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '140000', '100000-200000', '-22500', '36%', '-110000', '1125', '7', '-2');
INSERT INTO `we_card_outer_big_chance` VALUES ('40018', '4', '商务连锁酒店', 'share/atlas/battle/card/opportunity1/card_a_34.ab', '\\u3000\\u3000业主退休，希望马上出售该酒店。客户主要为旅游者。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '150000', '100000-300000', '-22500', '40%', '-120000', '1250', '7', '-3');
INSERT INTO `we_card_outer_big_chance` VALUES ('40019', '3', '金币', 'share/atlas/battle/card/opportunity1/card_a_43.ab', '\\u3000\\u3000收藏品拍卖会上，有财富金币10枚拍卖，每枚￥1，000.可以自己接受这笔生意，也可以卖给其他玩家。', '10', '10000', '0-5000', '-7500', '0%', '0', '0', '1', '0');
