INSERT INTO `we_card_outer_small_chance` VALUES ('20007', '4', '兼职办软件公司', 'share/atlas/battle/card/fixedcard1/card_d_47.ab', '\\u3000\\u3000你开发出一个有趣的游戏软件，筹备开公司生产并销售。开始没有利润，工作时间长，有额外工资。可以自己接受这笔生意，也可以卖给别人', '1', '5000', '售价未知', '-3750', '24%', '-1250', '2', '1', '125', '2', '0');
INSERT INTO `we_card_outer_small_chance` VALUES ('20008', '4', '投资健康有机甜品店', 'share/atlas/battle/card/fixedcard1/card_d_49.ab', '\\u3000\\u3000随着生活品质的改善，以及有机食品概念的提出，大中城市出现了对健康有机食品需求的热潮。你计划投资一个健康有机甜品店。可以自己接受这笔生意，也可以卖给别的玩家。', '1', '15000', '25000-50000', '-3750', '50%', '-11250', '2', '1', '375', '7', '-1');
INSERT INTO `we_card_outer_small_chance` VALUES ('20009', '4', '财富加油站', 'share/atlas/battle/card/fixedcard1/card_d_5.ab', '\\u3000\\u3000联合更多有志愿的人们深入和持续地学习财富文化，并把财富人生的智慧应用于生活和个人事业的发展中去，充分实践，并传播给大众，推动社会健康发展。可以自己接受这笔生意，也可以卖给别的玩家。', '1', '15000', '25000-50000', '-3750', '50%', '-11250', '2', '1', '500', '7', '-2');
INSERT INTO `we_card_outer_small_chance` VALUES ('20010', '4', '健康补给站', 'share/atlas/battle/card/fixedcard1/card_d_1.ab', '\\u3000\\u3000商业环境的全球化急速发展，市场需要一个永续经营的支撑平台，整合符合社区文化的各种优质健康产品和线上与线下服务，可以自己接受这笔生意，也可以卖给别的玩家。', '1', '15000', '25000-50000', '-3750', '50%', '-11250', '2', '1', '375', '5', '-2');
INSERT INTO `we_card_outer_small_chance` VALUES ('20011', '1', '待售公寓2室1厅', 'share/atlas/battle/card/fixedcard1/card_d_29.ab', '\\u3000\\u3000有人准备出售公寓，该公寓位于名校附近，出租率很高。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '40000', '45000-65000', '-3000', '60%', '-36000', '2', '1', '250', '5', '-1');
INSERT INTO `we_card_outer_small_chance` VALUES ('20012', '1', '待售公寓2室1厅', 'share/atlas/battle/card/fixedcard1/card_d_29.ab', '\\u3000\\u3000银行拍卖抵押品：一套两室一厅公寓，该公寓临近办公区和中心商业区。可以自己接受这笔生意，也可以卖给其他玩家。', '1', '40000', '45000-65000', '-3750', '52%', '-35000', '2', '1', '275', '4', '0');
INSERT INTO `we_card_outer_small_chance` VALUES ('20017', '1', '待售公寓3室2厅', 'share/atlas/battle/card/fixedcard1/card_d_34.ab', '\\u3000\\u3000高速公路管理部门出售老区的3室2厅居家一套。市场萧条，无人竞买。可以自己接受这笔生意,也可以卖给其他玩家。', '1', '50000', '65000-135000', '-1500', '0%', '-48000', '2', '1', '125', '3', '0');
INSERT INTO `we_card_outer_small_chance` VALUES ('20019', '1', '你发现了一宗买卖', 'share/atlas/battle/card/fixedcard1/card_d_39.ab', '\\u3000\\u3000公司收回已搬走的经理3室2厅的住宅房。该住宅房已经挂牌6个月了，刚贬值。如需要，可向银行贷款。', '1', '45000', '65000-135000', '-1500', '150%', '-43000', '2', '1', '313', '15', '-4');
