INSERT INTO `we_card_special` VALUES ('-994', '外圈晋级内圈', '恭喜您已经达到财务自由，欢迎来得富人圈。\\n您的所有资产将由银行托管，托管收益将每月按时发放。\\n{0}（富人圈流动现金基础值）={1}（创富圈非劳务收入）*100。\\n除此之外您在创富圈获得的时间积分、品质积分也将升值。\\n{2}（富人圈时间积分）={3}（创富圈时间积分）*100。\\n{4}（富人圈品质积分）={5}（创富圈品质积分）*10。', '', '0', null);
INSERT INTO `we_card_special` VALUES ('-993', '内圈进修学习', '如果您参与进修学习，请将{0}交给银行，缴纳费用为您总收入的10%，在下1轮您可投掷3粒骰子。', 'share/atlas/battle/card/specaill1/card_further_study.ab', '0', null);
