INSERT INTO `we_card_study` VALUES ('1', '《财富在金钱之外》悟语摘录', '“一个问题包含了不同的部分，既然‘我’也是问题的一部分，为什么不先调整好‘我’呢?”', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('2', '《财富在金钱之外》悟语摘录', '能活出自己，让自己时时感到幸福的人，对世界来说就是最大的贡献。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('3', '《财富在金钱之外》悟语摘录', '人类的疯狂在于所有人都想成为别人，就是不想成为自己。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('4', '《财富在金钱之外》悟语摘录', '假如人生是一次旅行，没有目的地的旅途将是难以想象的。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('5', '《财富在金钱之外》悟语摘录', '许多人挣扎着想去改变这个世界，却没有发现自己其实是第一个应该被改变的对象。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('6', '《财富在金钱之外》悟语摘录', '成功是相对的，成长是绝对的；成功很容易成为过去，成长却要一直进行到底。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('7', '《财富在金钱之外》悟语摘录', '只懂得使用头脑的人，可以说是世界上最不幸福的人。做事情，需要智慧，不做事情，需要更大的智慧！', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('8', '《财富在金钱之外》悟语摘录', '拿起更多并不能解决“放下”的问题。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('9', '《财富在金钱之外》悟语摘录', '人只有在心智平衡而有慈悲时，才能真正地放下，当平静的能力增长时，就有放下的能力。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('10', '《财富在金钱之外》悟语摘录', '当我们认识到时间的宝贵和时间亦有价格的那一刻，才是真正的富有。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('11', '《财富在金钱之外》悟语摘录', '最有本事的人不是什么伟大的领袖，而是能让自己活得轻松自在的人。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('12', '《财富在金钱之外》悟语摘录', '一个好的小说家，应该知道在什么时候为自己创作的故事画上句号。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('13', '《财富在金钱之外》悟语摘录', '钱是可以借用的，而时间绝不可以借用，时间远比金钱宝贵。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('14', '《财富在金钱之外》悟语摘录', '每次的金融风暴似乎都以不同的面貌出现，然而，不可忽略的规律是：人类应该警觉到，对于自身疯狂所创造的一切，迟早都要付出代价。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('15', '《财富在金钱之外》悟语摘录', '人类痴迷于追逐金钱使自己坠入一个怪圈。总有一天，人们会发现能用做交易和出售的就只剩下钞票了。然而可笑的是，人们拼搏的目的竟然还是为了要换取更多的钞票。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('16', '《财富在金钱之外》悟语摘录', '与其努力了解无常的事物，不如了解什么是恒久不变的规律。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('17', '《财富在金钱之外》悟语摘录', '人们在许多生活方式上追求自我个性，然而，却在最重要的人生大方向上放弃了自己的个性。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('18', '《财富在金钱之外》悟语摘录', '缺乏真正的觉醒，任何调整，都只是换了一种对观念的执著。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('19', '《财富在金钱之外》悟语摘录', '一个人如果可以源源不断地为自己创造满足感，就不会成为物质的奴隶。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('20', '《财富在金钱之外》悟语摘录', '只要慢慢地走，稳稳地走，总有一天你会发现，自己是那个走得最快和最远的人。', '2018-06-21 15:38:26', '2018-06-21 15:38:26');
INSERT INTO `we_card_study` VALUES ('21', '《财富在金钱之外》悟语摘录', '用复杂的眼睛很难看懂简单，但用简单的眼睛却能看懂复杂。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('22', '《财富在金钱之外》悟语摘录', '平静并非来自匮乏得到满足，而是来自“不满足”的结束 。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('23', '《财富在金钱之外》悟语摘录', '穷人苦于不知道路在哪里，而有钱人则苦于被困在路上。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('24', '《财富在金钱之外》悟语摘录', '死亡并不让人难过，让人难过的是，大多数人根本就没有真正活过。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('25', '《财富在金钱之外》悟语摘录', '赚钱需要时间，花钱和用钱需要更多的时间。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('26', '《财富在金钱之外》悟语摘录', '我们为金钱拼搏一生，但有一天当我们走到生命的尽头并回顾过去的时候，却会惊觉一个事实：大多数我们认为最有价值的东西几乎都与金钱无关。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('27', '《财富在金钱之外》悟语摘录', '许多人用健康和生命换来了巨额财富，却不曾思考最终到底由谁来享用。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('28', '《财富在金钱之外》悟语摘录', '开悟会在某个高度发生，好比爬楼梯需要到某个高度，才能看到不同的风景。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('29', '《财富在金钱之外》悟语摘录', '真正的富人并不想拥有金钱，他们只想操控金钱……', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('30', '《财富在金钱之外》悟语摘录', '投资制胜的关键不是看我们卖出的时候有多高，而是要看我们买入的时候有多低。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('31', '《财富在金钱之外》悟语摘录', '依托规律，而不是人，就会有安全感。既然知道迟早都会到，又何必只争朝夕呢？', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('32', '《财富在金钱之外》悟语摘录', '我们要解决的不是钱不够的问题，而是没有用好钱的问题。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('33', '《财富在金钱之外》悟语摘录', '人如果不能戒掉自己的坏习惯，就应该聪明地利用计划来管理自己。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('34', '《财富在金钱之外》悟语摘录', '平静并非来自“安全感”得到满足，而是来自“不安全感”的结束。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('35', '《财富悟语》摘录', '巨大财富的原理一直是极其简单的。它不需要任何人去发明如同自然法则，自古就存在。无论我们是否接受，它都一直在运作并主宰世界。而那些获得成果的，仅仅是更早明白这个道理并付诸行动的人。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('36', '《财富悟语》摘录', '生活对我们来说是一趟充满惊喜的旅程。“我是谁? 我从哪里来? 要到哪里去? 人生的目的和意义是什么?”当我们带着这些提问去生活，不断探索，就能时时保持觉醒的状态，不轻易落入各种险境，让自己成功到达终点。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('37', '《财富悟语》摘录', '人生是一趟旅行，就应该多看几个景点，多体验几种风情。不要沉醉于某个景点而不前进，不要忘记，旅途中所有的历练，都是为了让我们获得智慧，修炼一颗有力量的“心”让自己有能力创造自己的命运。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('38', '《财富悟语》摘录', '从一出生来到这个世界，人们就死记书本上各种复杂的事物，背诵文章，记住无数先人所留下的遗产一历史、文学、规章制度、文化、复杂的故事情节...却早已忘记了问自己是谁，来这里做什么。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('39', '《财富悟语》摘录', '我们总想从别人那里拿到立刻可以使用的答案。然而，任何一个答案都只适用于某个特殊的时间段，生命是由无数个片刻组成的，你如何才能把所有片段编织成自己最终所要的图画呢?', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('40', '《财富悟语》摘录', '成功是相对的，成长才是绝对的。每个人的一生中都会创造和拥有多种财富，因而财富应该是广义的。它不仅是指金钱的积累，还有自身全方位的成长。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('41', '《财富悟语》摘录', '探索外在世界的事物固然重要，但不要忘记，我们也需要化时间探索内在的自己。了解自我，驾驭自我，实现自我，超脱自我是人生的另一趟重要旅程。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('42', '《财富悟语》摘录', '金钱不是人生追求的终极目标，生活中有许多比金钱更重要的尔西。金钱是链接我们和梦想之间的一座桥梁，我们要牢记，它只是一个交易的工具，我们只需要借助它来造船，以渡我们到达幸福的彼岸。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('43', '《财富悟语》摘录', '从银行的存款票据发展到公司的股权证，再到今天到处散播的各种衍生出来的与钱有关的纸片，人们被“投资”这种活动搞得心神不宁，知道得越多，离开真实的生活就越远。人为的数字游戏使人们改变了生活的模式，在致富的同时也驱使人走向疯狂.....', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('44', '《财富悟语》摘录', '终生沉迷于金钱游戏的人是可悲的。许多人用健康和生命换来了巨额财富，却不曾思考最终到底由谁来享用。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('45', '《财富悟语》摘录', '穷人获得金钱却不懂得花在有价值的东西上，他们大部分的钱都是用在解决眼前紧急但对未来不重要的事情上，他们渴望改变，却没有意识到，要从每一件小事开始只有挤出自己的时间和资源，放到能对未来起作用的地方，改变才可能发生。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('46', '《财富悟语》摘录', '当“1”不存在的时候，后面的“0”就没有了意义。不少人都曾经拥有过巨额财富，只是后来因为各种原因又失去了，有人甚至还把自己也赔了进去。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('47', '《财富悟语》摘录', '人们挣扎着想去改变这个世界，却没有觉悟到其实自己才是第一个应该被改变的对象。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('48', '《财富悟语》摘录', '这个世界上不少有钱的穷人，他们并没有因为获得了机会而富足，反而因为乞求更多机会而变得焦虑，他们不知不觉地已被金钱操控了，成了金钱的奴隶，因而永远与富足无缘。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('49', '《财富悟语》摘录', '\"果实甜美，自然虫子也多”。人们在享受金钱和财富给生活带来的好处时，往往有意地忽略其伴随而来的麻烦。事物的利与弊好比一个铜钱的两面，正是因为在贪得无厌地积聚财富的同时，忘记了风险也在积聚，一不到心你就成了受害者，', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('50', '《财富悟语》摘录', '要保存和增值自己的钱，就需要把金钱安排在正确的地方，让它为我们工作，我们必需建立一个良好的机制，才不会让自己遭受奴役。唯有如此，我们才能谈得上“享用金钱”。事实上，有钱是好事。但知道如何使用金钱才会更好。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('51', '《财富悟语》摘录', '在投资领域人们最难的是找到平衡点，不是因为尝到了甜头而过度投资，就是因为为损失金钱之后从此远离投资市场。事实上，我们需要有风险管理的意识，好比一个人在高空作业时需要有安全网一样，在做任何投资决策之前，都应该对风险有一个客观的评估，采取合适的行动，这就是风险管理，', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('52', '《财富悟语》摘录', '缺钱的人不一定是穷人，不懂理财的人才是穷人。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('53', '《财富悟语》摘录', '我们应有能力意识到，我们作为地球上的一种生物是如此渺小，而自己所创造出来的各种概念就更加渺小.被自己的观念和文化所囚禁，我们就像从牢房的小窗户朝外观望，不愿迈出一步，所以也就不会知道外面的世界有多大。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('54', '《财富悟语》摘录', '除非我们了解金钱对自己的用途和意义，否则所有有的努力都将是徒劳的，那些金钱会变成折磨我们的魔鬼，把我们指挥得团团转。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('55', '《财富悟语》摘录', '经济低潮并不可怕，可怕的是我们没有足够的知识和应对的能力，通常，当一些资产下跌的同时，必定会有另外一些资产上升，把握好经经济的规律，顺势而为，自然无往而不利。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('56', '《财富悟语》摘录', '大自然中的树木懂得照顾到两个方向生长，然而，人却只想往上生长，不愿意往下生长。外在的历练灌溉着内在心灵的成长;而内在的感悟也在滋养着外在的成长，彼此相依为命，相互支撑。人生需要两个方向的平衡发展，一个是往外走的世界，一个是向内走的世界。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('57', '《财富悟语》摘录', '开悟意味着我们开启了自己最大的宝藏。我们这一生最重要的功课，就是修炼自己，使自己具有超越自我的能力.人最大的财富和功德，其实就是能够证悟自己存在的价值，突破人为观念的限制，让真实的生命像花朵一样绽放。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('58', '《财富悟语》摘录', '24. 对未来的迷惑，糟蹋了我们的每一个“当下”。我们急着等同未来临、暑假来临、孩子长大、老年退休...然而真相是:无论我们对“当下”是否满意，它就是我们生命的全部财富。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('59', '《财富悟语》摘录', '25. 为了证明自己，人们定下了许多不切实际的目标，克服无数难关，却忘记了生活的真谛。尤其是那些高智商的人群，他们喜欢给自己制造压力耗大量精力并填满所有的时间，以便使他们的生活“显得”充实。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('60', '《财富悟语》摘录', '当我们的智慧增加了，生活中的一些问题自然就会迎刃而解。假如我们有能力创造财富，却没有智慧能让自己的身心每天感觉舒适，那再多的成就又有什么意义?', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('61', '《财富悟语》摘录', '人生的重点是让自己有继续探索的机会，成功需要有冒险的精神，不断从错误中吸取教训，增长自己的智慧.然而，犯错误意味着风险，一个没有佩戴安全带而每天在高空作业的人，如果越爬越高，而且底下也没有安全网，那么其风险是难以想象的。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('62', '《财富悟语》摘录', '只有内在的智慧能驾驭恐惧和含婪，为我们掌管方向。心灵发出的光可以指引我们，不至于迷失，我们要成为自己的光。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('63', '《财富悟语》摘录', '人最大的财富和功德，其实就是能够证悟自己存在的价值，超越自我让真实的生命得到释放。学做一个真人，就是人生最大的工程: 圆满自己，就是对世界最大的贡献。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('64', '《财富悟语》摘录', '人可以失去热闹，但绝不能失去方向。致富很简单，如果一个人能看清规律，简单地遵循一个长期计划，那么几乎每个人都能成为百万富翁。然而，很多人却不愿投资时间，付出耐心，他们只想一夜暴富.', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('65', '《财富悟语》摘录', '金钱可以从别人那里借，而时间却不能借。人生这个银行里还剩下多少时间也无从知道。因此，时间更重要，价值是要用时间来计算的，因为时间比金钱更重要，很多人都想致富或去做富人进行的投资，但他们都不愿意投资时间。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('66', '《财富悟语》摘录', '管理自己的欲望是理财的首要部分，因为人的欲望膨胀的速度往往比赚钱的速度快。缺乏对自己整体的规划和管理，一不小心就会成为金钱的奴隶。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('67', '《财富悟语》摘录', '我们最终会发现财富也只是工具。金钱和财富都是我们人生中的工具，它是给我们提供旅行所需的通行证和门票。让我们能够不断前行，了解自我、驾驭自我、实现自我、超脱自我，最终获得自由，到达那真正健康、富足的彼岸。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_card_study` VALUES ('68', '《财富悟语》摘录', '生命是一次机会，是一次让我们可以通过经历生老病死:悲欢高合，体验与感悟，因而获得觉悟的机会。其实生命并不是一个从左边到右边的直线时间概念，它是一个立体超时空的存在。“当下”虽然是一个点，但它却是我们与大自然和宇宙唯一可以连接的地方。', '2018-06-21 15:38:27', '2018-06-21 15:38:27');
INSERT INTO `we_game_hall_notice` VALUES ('1', '智达富-财富人生之旅', '智富人生2.0版本更新内容：\n1、新增微信登陆功能，让登陆变得更加简单；\n2、新增联网对战功能，玩家可以通过匹配模式以及好友协作模式进行游戏；\n3、新增聊天功能，玩家可以在游戏中聊天交流了；\n\n愿景：让人们实现健康、自在、富足的人生。\n使命：通过体验游戏的方式，支持人们理解并最终为自己创造一个圆满丰盛的财富人生。', '0', '2018-04-11 11:12:44', '', '1', '10');
INSERT INTO `we_game_hall_notice` VALUES ('3', '24节气明星播报', '24节气明星播报，看看明星是怎么关注健康的', '0', '2018-04-11 11:12:47', 'http://www.asdyf.com/video_mobile/index.php', '1', '1');
INSERT INTO `we_game_hall_notice` VALUES ('14', '财富的智慧', 'http://118.144.74.82:8080/game/gameNotice/getImg?id=6', '1', '2018-04-11 11:12:49', 'http://www.selfwealth.com.cn', '1', '1');
INSERT INTO `we_game_hall_notice` VALUES ('21', '富足人生行动', '智达富游戏是一趟浓缩的旅程，让我们看清完整的人生。从出生的那一刻开始，我们就被送进了布满各种通关的考场，错综复杂的考验磨砺着每一个人的智慧，尤其是关于金钱与财富的关卡，充满了太多的诱惑与挑战，有人踌躇满志，有人因被困而沮丧，还有一些人彷徨无助。穷人与富人最大的区别就是我们对财富的认知，当我们真正的了解自己与财富的关系时,我们就能轻松驾驭金钱......', '0', '2018-04-20 17:28:27', 'http://wealthlife.cfwh.com.cn/action/action_5.html', '1', '2');
